// FetchDataPage.js

import React, { useState } from 'react';

const FetchDataPage = () => {
  const [criteria, setCriteria] = useState({
    name: '',
    school: '',
    week: '',
  });
  const [fetchedData, setFetchedData] = useState('');

  const handleFetchData = async () => {
    try {
      const queryParams = new URLSearchParams(criteria);
      const response = await fetch(`/api/entries?${queryParams}`);
      const result = await response.json();

      if (result.length > 0) {
        setFetchedData(JSON.stringify(result, null, 2));
      } else {
        setFetchedData('No data available');
      }

      console.log(result);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div style={{ maxWidth: '400px', margin: 'auto' }}>
      <h2>Fetch Data</h2>
      <label htmlFor="name">Name:</label>
      <input type="text" value={criteria.name} onChange={(e) => setCriteria({ ...criteria, name: e.target.value })} />

      <label htmlFor="school">School:</label>
      <input type="text" value={criteria.school} onChange={(e) => setCriteria({ ...criteria, school: e.target.value })} />

      <label htmlFor="week">Week:</label>
      <input type="text" value={criteria.week} onChange={(e) => setCriteria({ ...criteria, week: e.target.value })} />

      <button onClick={handleFetchData}>Submit</button>
      <div style={{ marginTop: '10px' }}>
        <strong>Fetched Data:</strong>
        <pre style={{ whiteSpace: 'pre-wrap' }}>{fetchedData}</pre>
      </div>
    </div>
  );
};

export default FetchDataPage;
